import React, { Component } from 'react';
import { MapContainer } from '../node_modules/react-leaflet/lib/MapContainer';
import { TileLayer } from '../node_modules/react-leaflet/lib/TileLayer';
//import { Hooks } from '../node_modules/react-leaflet/lib/hooks';
import { Marker } from '../node_modules/react-leaflet/lib/Marker';
import { Popup } from '../node_modules/react-leaflet/lib/Popup';

class Geolocalizacao extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <h3 style={{ marginTop: '30px', marginBottom: '1px' }}>Obtenha sua localização</h3>
                <span>Permita acesso no seu navegador.</span>
                <br />
                <MapContainer center={[-29.6578685, -50.7574868,16]} zoom={13} scrollWheelZoom={false}>
                    <TileLayer
                        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
                        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                    />
                    <Marker position={[-29.6578685, -50.7574868,16]}>
                        <Popup>
                            A pretty CSS3 popup. <br /> Easily customizable.
                        </Popup>
                    </Marker>
                </MapContainer>
            </div>
        );
    }
}

export default Geolocalizacao;
